function reset() {
    this.mapState = this.mapState || {}
    this.mapState.doNotSerialize = ['map', 'markers'];
    if (this.mapState.map) google.maps.event.clearInstanceListeners(this.mapState.map);
    this.mapState.map = null;
    if (this.mapState.markers && this.mapState.markers.length) this.removeAllMarkers();
    this.mapState.markers = [];
    this.mapState.canvasId = "map-canvas-" + this.id;
    this.mapState.mapOptions = this.mapState.mapOptions || {
        center: {lat: -34.397, lng: 150.644},
        zoom: 8,
        mapTypeId: 'roadmap'
    }
    this.setHTML('<div style="height:100%" id="' + this.mapState.canvasId + '"/>');
    this.setName('GoogleMapsCanvas');
}

