function loadGoogleMapsAPI(thenDo) {
    // this.init();
    if (typeof google !== 'undefined' && typeof google.maps !== 'undefined') {
        if (google.maps.Load) { this.loadGoogleMapsAPI.bind(this, thenDo).delay(0.3); return; }
        thenDo.call(this, null); return; }
    var initFuncName = 'google_maps_init';
    if (Global[initFuncName]) { this.loadGoogleMapsAPI.bind(this, thenDo).delay(0.3); return; }
    function initGoogle() {
        alertOK('Google Maps API loaded');
        delete Global[initFuncName];
    }
    Global[initFuncName] = initGoogle;
    var url = "https://maps.googleapis.com/maps/api/js?"
            + "key=AIzaSyCqIO22KtIs_lxhyhDJf-MpwvFIx8n9Z-4&"
            + "sensor=false&callback=" + initFuncName;
    JSLoader.loadJs(url, false, true);
    this.loadGoogleMapsAPI.bind(this, thenDo).delay(0.3);
}

