function ensureMapOptions(mapState) {
    // mapState = this.mapState
    if (typeof google === 'undefined') return null;
    var opts = Object.extend({}, mapState.mapOptions);
    // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-
    // center
    if (!opts.center) {
        opts.center = new google.maps.LatLng(-34.397, 150.644);
    } else if (!(opts.center instanceof google.maps.LatLng)) {
        opts.center = new google.maps.LatLng(opts.center.lat || -34.397, opts.center.lng || 150.644);
    }
    // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-
    // mapType
    if (!opts.mapTypeId) {
        opts.mapTypeId = google.maps.MapTypeId.ROADMAP;
    } else if (Object.isString(opts.mapTypeId)) {
        opts.mapTypeId = google.maps.MapTypeId[opts.mapTypeId.toUpperCase()]
    }
    // misc
    opts.zoom = opts.zoom || 8;
    return opts;
}

