function addMarker(pos, options) {
    var map = this.mapState.map,
        ev = google.maps.event,
        latLng = pos instanceof google.maps.LatLng ? pos: new google.maps.LatLng(pos.lat || pos.x, pos.lng || pos.y),
        marker = new google.maps.Marker({position: latLng});
    marker.setMap(map);
    if (!this.mapState.markers) this.mapState.markers = [];
    this.mapState.markers.push(marker);
    if (options.onMouseDown) {
        google.maps.event.addListener(marker, 'click', function() {
            options.onMouseDown(event, marker);
      });
    }
    if (options.info) {
        marker.info = new google.maps.InfoWindow({content: options.info. content || options.info});

        if (options.info.hover) {
            ev.addListener(marker.info, 'closeclick', function() { marker.info.stayOpen = false; });
            ev.addListener(marker, 'mouseout', function() { if (!marker.info.stayOpen) marker.info.close(); });
            ev.addListener(marker, 'mouseover', function() { marker.info.open(map, marker); });
            ev.addListener(marker, 'click', function() { marker.info.stayOpen = true; });
        } else {
            ev.addListener(marker, 'click', function() { marker.info.open(map, marker); });
        }
    }
}

