function removeAllMarkers() {
    // this.removeAllMarkers();
    if (!this.mapState.markers || !this.mapState.markers.length) return;
    var m; while ((m = this.mapState.markers.shift())) {
        google.maps.event.clearInstanceListeners(m);
        m.setMap(null);
    }
}

